import React, { Component } from "react";

class MainContent extends Component {
  state = {
    pageTitle: "Clientes",
    customersCount: 5,
  };

  render() {
    return (
      <div>
        <h4 className="border-bottom m-1 p-1">
          {this.state.pageTitle}
          <span>{this.state.customersCount}</span>
        </h4>
      </div>
    );
  }
}

export default MainContent;
